diversiteit.kaart.prototype.parseLegend=function(x) {
	var self = this;

	var obj = null;
	var tmp = null;
	if(x == 0) {
		obj = this.svg.selectAll('.legend')
			.data([0, 1, 2, 3, 4, 5])
				.enter()
	} else {
		tmp = this.svg.selectAll(this.parent+' rect.legend')
	}

	if(x == 0) {
		tmp = obj.append('rect')
	} else {
		if(this.transitionSpeed > 0 && this.transition == true) {
			tmp = tmp.transition().duration(this.transitionSpeed)
		}
	}
	tmp
		.attr("class", "legend")
		.attr("x", this.width/50)
		.attr("y", function(d, i) {
			return (self.height-17)-((5-i)*8)-(7*(5-i));
		})
		.attr("width", 8)
		.attr("height", 8)
		.style('stroke', 'black')
		.style('stroke-width', '0.5')
		.style('fill', function(d, i) {
			return self.blue[d];
		});

	var tmp = null;
	if(x == 0) {
		tmp = obj.append('text')
	} else {
		tmp = this.svg.selectAll(this.parent+' text.legend')
		if(this.transitionSpeed > 0 && this.transition == true) {
			tmp = tmp.transition().duration(this.transitionSpeed)
		}
	}
	tmp
		.attr("class", "legend")
		.attr("font-size", function(d, i) {
			if(self.height < 400) {
				return 12;
			} else {
				return 12;
			}
		})
		.style("fill", "black")
		.attr("x", function(d, i) {
			return (self.width/50+10+5);
		})
		.text(function(d, i) {
			return self.legend[i];
		})
		.attr("y", function(d, i) {
			return (self.height-17)-((5-i)*9)-(6*(5-i))+7;
		})
}

diversiteit.kaart.prototype.create=function(parent) {
	var self = this;
	this.parent = parent;

	var h = d3.select(this.parent).style('height').replace('px',''),
		w = d3.select(this.parent).style('width').replace('px','');

	this.width = w;
	this.height = h;

	var container = d3.select(this.parent).select('svg');
	if(container.empty() == true) {
		this.svg = d3.select(this.parent).append("svg")
			.append("g")
				.attr("class", this.id)
	} else {
		this.svg = container.select('#'+this.id);
	}

	tmp = d3.select(this.parent).select('svg')
	tmp
		.attr("width", this.width+'px')
		.attr("height", this.height+'px');

	this._calc();

	d3.select('.kaart').on("mouseover", function(d, i) {
		var z = d;
		d3.select(this).selectAll('.tooltip').remove();
		d3.event.stopPropagation();
	})
	
	var obj = this.svg.append("g")
		.attr("id", "states")
			.selectAll("path")
				.data(this.geo['2015'].features)
					.enter()
						.append("path")
							.attr("class", function(d, i) {
								if('properties' in d) {
									if('klasse' in d['properties']) {
										if(d['properties']['klasse'] == 'stadsdeel') {
											return "stadsdeel "+d['properties']['code'];
										}
										if(d['properties']['klasse'] == 'bebouwing_referentie') {
											return 'referentie bebouwing';
										}
										if(d['properties']['klasse'] == 'water_grof') {
											return 'water';
										}
										if(d['properties']['klasse'] == 'ringweg') {
											return 'ringweg';
										}
										if(d['properties']['klasse'] == '22gebieden') {
											return 'gebied22 '+d['properties']['code']+' '+d['properties']['stadsdeel'];
										}
										if(d['properties']['klasse'] == 'wijk_water') {
											if('code' in d['properties'] && [98,73,80].indexOf(parseInt(d['properties']['code'])) == -1) {
												return 'wijk _'+parseInt(d['properties']['code']);
											}
											return 'wijk';
										}
										if(d['properties']['klasse'] == 'wijk_agglomeratie') {
											if('code' in d['properties']) {
												return 'wijk _'+parseInt(d['properties']['code']);
											}
											return 'wijk';
										}
									}
								}
							})
							.attr("d", this.path)
							.style("fill", function(d, i) {
								if(d['properties']['klasse'] == 'stadsdeel' || d['properties']['klasse'] == '22gebieden') {
									return _diversiteit.colors['kaart-bg'];
								}
							})
							/*
							 * Nieuw
							 */
							.on("mouseover", function(d, i) {
								d3.event.stopPropagation();
								var z = d;
								d3.select(this.parentNode).selectAll('.tooltip').remove();
								if(d['properties']['klasse'] == '22gebieden' || d['properties']['klasse'] == 'stadsdeel') {
									d3.select(this.parentNode)
										.append("text")
											.attr("class", "tooltip")
											.text(d3.select(this).attr("data"))
											.attr("x", function() {
												return self.path.centroid(z)[0]-(this.getBBox().width/2);
											})
											.attr("y", function() {
												return self.path.centroid(z)[1]+(this.getBBox().height/2);
											})
											.on("mouseover", function(d, i) {
												d3.event.stopPropagation();
											});
								}
							})

	this.parseLegend(0);
}

diversiteit.kaart.prototype.setData=function(cat) {
	var self = this;
	var wijken = [];

	if(cat.length == 7) {
		d3.selectAll(this.parent+' .gebied22')
			.transition().duration(this.transitionSpeed).delay(this.transitionSpeed).ease("linear")
				.style("visibility", "hidden")
				.style("opacity", 0);
	} else if(cat.length == 22) {
		d3.selectAll(this.parent+' .stadsdeel')
			.transition().duration(this.transitionSpeed).delay(this.transitionSpeed).ease("linear")
				.style("visibility", "hidden")
				.style("opacity", 0);
	}
	for(var i in cat) {
		var klasse = null;
		var key = Object.keys(cat[i])[0];
		var idx = cat[i][key].toString().split('~')[0];
		var dat = cat[i][key].toString().split('~')[1];

		if(cat.length == 7) {
			klasse = '.stadsdeel.'+key;
		} else if(cat.length == 22) {
			klasse = '.gebied22.'+key;
		}

		d3.selectAll(this.parent+" "+klasse)
			.style("visibility", "visible")
		d3.selectAll(this.parent+" "+klasse)
			.transition().duration(this.transitionSpeed).delay(this.transitionSpeed).ease("linear")
				.attr("data", dat+'%')
				.style("fill", function() {
					return self.blue[idx];
				})
				.style("opacity", 1)
	}
}

diversiteit.kaart.prototype.reset=function() {
	d3.selectAll(this.parent+" path.stadsdeel")
		.transition().duration(this.transitionSpeed).delay(this.transitionSpeed).ease("linear")
			.style("fill", _diversiteit.colors['kaart-bg'])
	d3.selectAll(this.parent+" path.gebied22")
		.transition().duration(this.transitionSpeed).delay(this.transitionSpeed).ease("linear")
			.style("fill", _diversiteit.colors['kaart-bg'])
}

diversiteit.kaart.prototype._calc=function() {
	var self = this;

	this.center = d3.geo.centroid(this.geo['2015']);
	this.projection = d3.geo.mercator().scale(1).center(this.center).translate([0,0]);
	this.path = d3.geo.path().projection(this.projection);

	var bounds  = this.path.bounds(this.geo['2015']);
	bounds.dx = Math.abs(bounds[1][0] - bounds[0][0]);	// distance x = E-W
	bounds.dy = Math.abs(bounds[1][1] - bounds[0][1]);	// distance y = N-S
	bounds.cx = (bounds[1][0] + bounds[0][0]) / 2; 	// center x
	bounds.cy = (bounds[1][1] + bounds[0][1]) / 2; 	// center y

	var ratio = (bounds.dy / bounds.dx );
	this.scale = 1 * Math.min(this.width/bounds.dx, this.height/bounds.dy); // = .9 * ( width / b.dx)
	this.translate = [(this.width/2 - this.scale * bounds.cx), (this.height/2 - this.scale * bounds.cy)];

	this.projection.scale(this.scale).translate(this.translate);
	this.path.projection(this.projection);
}

diversiteit.kaart.prototype.redraw=function() {
	var h = d3.select(this.parent).style('height').replace('px',''),
		w = d3.select(this.parent).style('width').replace('px','');

	this.width = w;
	this.height = h;

	tmp = d3.select(this.parent).select('svg')
	if(this.transitionSpeed > 0 && this.transition == true) {
		tmp = tmp.transition().duration(this.transitionSpeed)
	}

	tmp
		.attr("width", this.width+'px')
		.attr("height", this.height+'px')

	this._calc();

	var obj = this.svg.select('#states').selectAll('path')
		.transition().duration(this.transitionSpeed)
			.attr("d", this.path);
}

