diversiteit.prototype.getCategory=function(json, id) {
	for(var i in json) {
		if(typeof json[i] == 'object') {
			if(json[i]['type'] == "subcategorie") {
				if(json[i]['id'] == id) {
					return json[i];
				}
			}
			if(json[i]['type'] != "subcategorie") {
				var x = _diversiteit.getCategory(json[i]['children'], id);
				if(x !== false) {
					return x;
				}
			}
		}
	}
	return false;
}

diversiteit.prototype.parseData=function(csv) {
	data = new Array();
	var row = csv.split("\n");
	for(var i in row) {
		data[i] = new Array();
		var col = row[i].split(";");
		for(var x in col) {
			data[i][x] = col[x];
		}
	}
}

diversiteit.prototype.getCrossing=function(niv) {
	var ret = [];
	var tmp = niv.split('-');
	for(var x in data[0]) {
		if(data[0][x].substring(0, niv.length) == niv && data[0][x].length > niv.length && data[0][x][niv.length] == '-') {
			ret.push(data[0][x].split('-')[tmp.length]);
		}
	}

	return ret;
}

diversiteit.prototype.getText=function(ind) {
	for(var x in data[0]) {
		if(data[0][x].trim() == 'T'+ind) {
			return data[1][x];
		}
	}
	return '';
}

diversiteit.prototype.getValues=function(niv, ind) {
	var ret = [];
	var nivcol = -1;
	var indcol = -1;
	for(var x in data[0]) {
		if(data[0][x] == niv) {
			nivcol = parseInt(x);
			break;
		}
	}
	for(var x=nivcol+1;x<data[0].length;x++) {
		if(data[0][x].substring(0, 1) != 'I') {
			break;
		}
		if(data[0][x] == ind) {
			indcol = parseInt(x);
		}
	}

	if(nivcol == -1 || indcol == -1) {
		return ret;
	}

	for(var i in data) {
		if(i > 0) {
			if(typeof data[i][nivcol] == 'string' && data[i][nivcol].length > 0) {
				var obj = {};
				obj[data[i][nivcol]] = data[i][indcol].replace(',', '.');
				ret.push(obj);
			}
		}
	}

	return ret;
}

